//material UI complete course
import {Button,Typography,IconButton, TextField} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import SendIcon from  '@mui/icons-material/Send';
import Fingerprint from  '@mui/icons-material/Fingerprint';

function Mui() {
    return (
        <>
        {/* for heading paragraph (h1,h2,p etc) */}
            <Typography
                variant='h4'
                sx={{ color: 'red' }}
                component={'p'}
                m={3}
            >
                we are learning MUI
            </Typography>
            <br/>

            {/* buttons */}

            <Button>click me</Button>
            <Button variant='contained'>click me</Button>
            <Button variant='text'>click me</Button>
            <Button variant='outlined'>click me</Button>
            <Button variant="contained" disableElevation>Disable elevation</Button>
            <Button disabled>Disabled</Button>
            <Button href="#text-buttons">Link</Button>
            <Button
                onClick={() => {
                    alert('clicked');
                }}
            >
                Click me
            </Button>

            <Button color="secondary" size="small">Secondary</Button>
            <Button variant="outlined" color="error" startIcon={<DeleteIcon />}> delete</Button>
            <Button variant="outlined" color="success" endIcon={<SendIcon />}> SEND</Button>

            <br />
            {/* icon btn */}
            
            <IconButton aria-label="delete"  color="warning" size='large'>
               <DeleteIcon fontSize='inherit'/>
            </IconButton>

            <IconButton aria-label="send"  color="success">
               <SendIcon />
            </IconButton>

            <IconButton aria-label="send"  color="secondary">
               <Fingerprint />
            </IconButton>

            <br/>

            {/* textfield like input */}

            <TextField type='text' placeholder='name' sx={{margin:'20px'}} />
            <TextField type='password' placeholder='password' variant='standard' sx={{margin:'20px'}}/>
            <TextField type='email' placeholder='email' variant='outlined' sx={{margin:'20px'}}/>
            <TextField type='number' placeholder='number' variant='filled' sx={{margin:'20px'}}/>


        </>
    )
}

export default Mui;
